import './Plant.css'

function Plant() {
    const firstWater = new Date(2021, 2, 28);
    const plantName = 'Pothos';
    const frequency = 'Once a week';


    return (
        <div className="individual-plant">
            <div>{firstWater.toISOString()}</div>
            <div className="plant-info">
            <h2>{plantName}</h2>
            <div className="water-frequency">Once a Week</div>
            </div>
        </div>
    );

}

export default Plant;
